<script>
    $(document).ready(function () {
    function performSearch() {
        var searchInput = $("#reportSearch").val().toLowerCase();

        $(".list-item").hide();

        var resultFound = false;

        $(".list-item").each(function () {
            var title = $(this).find(".text-container h2").text().toLowerCase();
            if (title.includes(searchInput)) {
                $(this).show();
                resultFound = true;

                var newUrl = window.location.href.split('?')[0] + '?search=' + encodeURIComponent(searchInput);
                window.history.pushState({ path: newUrl }, '', newUrl);
            }
        });

        if (!resultFound) {
            alert('No results found for: ' + searchInput);
        }
    }

    $("#searchButton").on("click", function () {
        performSearch();
    });

    $("#reportSearch").keypress(function (e) {
        if (e.which === 13) {
            // 13 is the key code for Enter
            performSearch();
        }
    });

    var urlParams = new URLSearchParams(window.location.search);
    var searchQuery = urlParams.get('search');
    if (searchQuery) {
        $("#reportSearch").val(decodeURIComponent(searchQuery));
        performSearch();
    }
});

</script>

